import clsx from 'clsx';
import React from 'react';
import { recipeTag, recipeTagsContainer } from '../../../styles/styles';

const RecipeTags: React.FC = () => {
	const recipeTags: string[] = ['Pizza', 'Italian'];

	return (
		<div className={recipeTagsContainer}>
			{recipeTags.map((element) => (
				<div className={recipeTag}>
					<h3 className={clsx('nunito-sans-small', 'background-[#c65f00]')}>
						{element}
					</h3>
				</div>
			))}
		</div>
	);
};

export default RecipeTags;
